import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';  // Import Link for navigation
import Routes from './Routes';  // Routes component that handles different routes
import './App.css'; // Ensure this is imported

const App = () => {
  return (
    <Router>
      {/* Navigation Bar */}
      <nav className="navbar">
        <ul className="navbar-list">
          <li><Link to="/">Home</Link></li>  {/* Link to Home page */}
          <li><Link to="/details">Weather Details</Link></li>  {/* Link to Weather Details page */}
          <li><Link to="/settings">Settings</Link></li>  {/* Link to Settings page */}
          <li><Link to="/about">About Us</Link></li>  {/* Link to About Us page */}
          <li><Link to="/feedback">Feedback</Link></li>  {/* Link to Feedback page */}
          <li><Link to="/forecast">15-Day Forecast</Link></li>  {/* Link to 15-Day Forecast page */}
          <li><Link to="/map">Map Visualization</Link></li>  {/* Link to Map Visualization page */}
          <li><Link to="/login">Login/Registration</Link></li>  {/* Link to Login/Registration page */}
          <li><Link to="/team">Team Page</Link></li>  {/* Link to Team Page (Optional) */}
        </ul>
      </nav>

      {/* Routes for different pages */}
      <Routes />
    </Router>
  );
};

export default App;
